import React, { Component } from "react";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";
import axios from "axios";
import ReCAPTCHA from "react-google-recaptcha" 

export default class Register extends Component {

    state = {
      firstname: "",
      middlename: "",
      lastname: "",
      password: "",
      email: "",
      phone: "",
      address: "",
      datas: [],
      isVerified : false
    };

  componentWillMount(){

  }

  componentDidMount(){

  }

  handlechange = (event) => {

      const target = event.target;
      const name = target.name;
      const value = target.value;

      this.setState({
        [name]: value,
      });

  };


recaptchaLoaded(){
  console.log("reCAPTHA loaded successfuly")
}



 checkforVerification = (event) =>{
    if(this.isVerified){
    this.submit(event)
    }
  }

  submit = async (event) => {
    event.preventDefault();


    const payload = {
      firstname: this.state.firstname,
      middlename: this.state.middlename,
      lastname: this.state.lastname,
      email: this.state.email,
      password: this.state.password,
      phone: this.state.phone,
      address: this.state.address
    };

    await axios({
      url: "http://commerchant.herokuapp.com/accounts/register",
      method: "POST",
      data: payload,
    })
      .then(
        (response) => (
          this.setState({ datas: response }), 
          alert(response.data.message)
        )
      )
      .catch(() => console.log("Register Başarısız"));
    };


  onloadCallback = function() {
    this.setState({isVerified : true})
  }


  render() {
    return (
      <div>
        <h3>{this.props.currentCategory}</h3>
        <Form onSubmit={this.submit}>
          <FormGroup>

              <Label for="name">First Name</Label>
              <Input
                type="text"
                name="firstname"
                value={this.state.name}
                placeholder="Enter Your First Name!"
                onChange={this.handlechange}
              />
            </FormGroup>

            <FormGroup>
            <Label for="middlename">Middle Name</Label>
            <Input
              type="text"
              name="middlename"
              value={this.state.username}
              placeholder="Enter Your Middle Name!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="lastname">Last Name</Label>
            <Input
              type="text"
              name="lastname"
              value={this.state.username}
              placeholder="Enter Your Last Name!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="email">Email</Label>
            <Input
              type="email"
              name="email"
              value={this.state.email}
              placeholder="Enter your e-mail!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="password">Password</Label>
            <Input
              type="password"
              value={this.state.password}
              name="password"
              placeholder="Enter Your Password!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="phone">Phone</Label>
            <Input
              type="text"
              pattern="[0-9]*"
              name="phone"
              value={this.state.contact}
              placeholder="Enter Your Phone Number!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="address">Address</Label>
            <Input
              type="text"
              name="address"
              value={this.state.contact}
              placeholder="Enter Your Address!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <ReCAPTCHA
            sitekey="6LeIxAcTAAAAAJcZVRqyHh71UMIEGNQ_MXjiZKhI"
            render= "explicit"
            onChange={this.onloadCallback} 
           />
          <Button>Submit</Button>
        </Form>
      </div>
    );
  }
}
